import React, { useEffect } from "react";
import axios from "axios";

const ViewJobs = () => {
  let jobs;
  useEffect(() => {
    axios.get("http://localhost:8080/jobs").then((response) => {
      console.log("requested");
      // displayJobs(response.data);
      jobs = response.data;
    });
  });

  const printJobs = () => {
    return <h1>Jobs List</h1>;
  };

  return (
    <div>
      <h1>View Jobs</h1>
      {printJobs()}
    </div>
  );
};

export default ViewJobs;
